import React, { useState } from "react";
import "./Login.css";
import Logo from "../../img/logo.webp";

const Login = () => {
    const [isSignUp, setIsSignUp] = useState(false);

  return (
    <div className="Login">
        {/* LeftSide with the logo and navbar */}
      <div className="a-left">
        <img src={Logo} alt="HobbyHUB custom logo shout out Ari!" />
        <div className="Webname">
          <h1>Hobby Hub</h1>
        </div>
      </div>
        {/* rightside  */}
      <div className="a-right">
      <form className="infoForm loginForm">
        <h3>{isSignUp ? "Sign up":"Log In"}</h3>
        <div>
          <input
            type="text"
            placeholder="First Name"
            className="infoInput"
            name="firstname"
          />
          <input
            type="text"
            placeholder="Last Name"
            className="infoInput"
            name="lastname"
          />
        </div>
        <div>
          <input
            type="text"
            className="infoInput"
            name="hobbies"
            placeholder="Hobbies"
          />
        </div>
        <div>
          <input
            type="text"
            className="infoInput"
            name="username"
            placeholder="Username"
          />
        </div>
        <div>
          <input
            type="text"
            className="infoInput"
            name="email"
            placeholder="Email"
          />
        </div>

        <div>
          <input
            type="text"
            className="infoInput"
            name="password"
            placeholder="Password"
          />
          <input
            type="text"
            className="infoInput"
            name="confirmpass"
            placeholder="Confirm Password"
          />
        </div>

        <div>
            <span style={{fontSize: '14px'}}>Already have an account. Login!</span>
        </div>
        <button className="button infoButton" type="submit">Sign up</button>
      </form>
    </div>
      {/* <LogIn/>  */}
      {/* <SignUp/> */}
    </div>
  );
};
